import React from 'react';
import './Header.css';

import Title from '../../elements/Title';


function Header() {
    const [show, setShow] = React.useState(true);

    if (show) {
        return(
            <Title />
        )
    } else {
        return(
            <div>

            </div>
        )
    }

}

export default Header;
